import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as t,c as a,f as o}from"./app-5820e0a5.js";const l={},n=o('<h1 id="beneath-the-depths-level-60" tabindex="-1"><a class="header-anchor" href="#beneath-the-depths-level-60" aria-hidden="true">#</a> Beneath the Depths(level 60)</h1><p><strong>深空之下</strong></p><p>1.在Pirate Cove与Javier<code>[-640 53 -3117]</code>对话</p><blockquote><p>Pirate Cove的船票可以在Selchar/Llevigar购买</p></blockquote><p>2.找到藏在Skull Cave<code>[-673 45 -3190]</code>(岛屿上有个巨大骷髅的嘴巴)的Javier的地图</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>(迷宫里有个房间有猪人，路线为进去下楼梯后直走、左拐。里面有个下陷的地方隐藏了漏斗，开门需要丢一个绿宝石块在地毯<code>[-683 19 -3206]</code>上，之后你身后的墙会打开，走到前面会触发机关一面墙被打开(这里你走过)上楼，有一个尸体会扑过来，打死他之后向前走，小心地上有1个会消失的地板和很多地雷.最后过一个躲避球(炮弹高度一定，右二上有地方可以停步，然后前方会有个坑,下去到底。)</p></div><p>3.给<em>Javier</em><code>[-640 53 -3117]</code>已经褪色的地图</p><p>4.<em>Javier</em>会还给你地图。带着地图去到在<strong>Mage Island</strong>的<em>Dalben**[883 46 -2872]</em></p><p>5 给<em>Dalben</em> 5 个 绿宝石块 和 1 个 褪色的地图</p><p>6.Dalben给你一个unenchanted map(未附魔的地图)。按照地图的标记寻找到指定的位置，并且进入OceanCave<code>[-187 16 -3452]</code>。进入洞穴之后向南走，走通道不要进大房间小房间，(小心某个没有实体一击就死但是一套伤害1800的怪，有特殊音效)。走到底<code>[-78 14 -3039]</code>并且杀死宝藏守护者[Treasure Guardian]。你将会获得一个叫做Ocean Treasure(海之宝藏)的金条。原路返回，带着他回去给Javier</p><p>奖励</p><ul><li>185000 经验</li><li>1 绿宝石(对，就一个绿宝石)</li><li>Abysso Galoshes(Quest Item)</li><li>一个帆船葬场的钥匙</li></ul><div class="hint-container tip"><p class="hint-container-title">提示</p><p>1.记得带着5个EB在你去找Dalben之前，以免你往返两次。海盗岛上有银行(？？？哪里不对)</p><p>2.最后海底洞里的怪物有很小概率掉Naval stone三星材料，挺值钱的，</p><p>3.完成任务之后可以购买一个Pirate Luck(32lb)，用来跑loot run，位置<code>[-621 53 -3078]</code>，注意非常非常贵</p></div>',13),c=[n];function i(p,r){return t(),a("div",null,c)}const h=e(l,[["render",i],["__file","level 60 - Beneath the Depths.html.vue"]]);export{h as default};
